import Resume_PDF from "./assets/Resume.pdf";

export const cubeFaces = [
  "fa-python",
  "fa-react rotate-90",
  "fa-js",
  "fa-git",
  "fa-html5",
  "fa-css3",
];

export const sideIcons = [
  {
    icon: "fa-jedi",
    label: "Home",
    path: "/",
  },
  {
    icon: "fa-book-journal-whills",
    label: "About",
    path: "/about",
  },
  {
    icon: "fa-swords-laser",
    label: "Skills",
    path: "/skills",
  },
  {
    icon: "fa-starfighter",
    label: "Contact",
    path: "/contact",
  },
];

export const sideLinks = [
  {
    icon: "fas fa-file",
    link: Resume_PDF,
    title: "My Resume PDF",
  },
  {
    icon: "fab fa-github",
    link: "https://github.com/Kardarigan",
    title: "Me in GitHub",
  },
  {
    icon: "fab fa-medium",
    link: "https://medium.com/@darigan",
    title: "My Meduim Account",
  },
];

export const skills = [
  "HTML5",
  "CSS3",
  "Javascript ES6+",
  "JQuery",
  "React.js",
  "Pug",
  "Sass",
  "Tailwind",
  "Bootstrap",
  "Python",
  "Django",
];
